import axios from 'axios';
import { useEffect } from 'react';

const DataFetch = () =>{
    const api = async() =>{
        await axios.get(`https://motherdivinefertility.in:3001/api/alldata`)
        .then((res) =>{console.log(res)})
        .catch((err) =>{console.log(err)});
    }
    useEffect(() =>{
        api();
    }, []);
    
    return(
        <>
            <h2>Mother Divine Fertility</h2>
        </>
    )
}

export default DataFetch;
